import './NavBar.css';

export default function NavBar() {
    return (
        <header>
            <div class="container">
                <a class="logo-text" href="index.html">Arnav Bista</a>
                <nav>
                    <ul>
                        <li><a href="#">About Me</a></li>
                        <li><a href="#">Projects</a></li>
                    </ul>
                </nav>
            </div>
        </header>
    );
}
